import React from 'react';

const ProjectTable = () => {
        return (
            <>
                <table className="project-tables">
                    <thead>
                        <tr>
                            <th>ID</th>
                            <th>Название</th>
                            <th>Описание</th>

                        </tr>
                    </thead>
                </table>

            </>
        );
    }

export default ProjectTable;
